import './App.css';
import { BrowserRouter, Link, Route, Router, Switch, useHistory } from "react-router-dom";
import OnePost from "./components/OnePost";
import React from "react";
import HomePageComponent from './components/HomePageComponent';
import { AppBar, Box, Container, Tab, Tabs, Typography } from '@material-ui/core';

class App extends React.Component {

  constructor(props){
    super(props)
    this.setState({
      value: null,
      setValue: null
    })
  }

  handleChange = (event, newValue) => {
    this.setState({ setValue: newValue});
  };

  a11yProps(index) {
    return {
      id: `simple-tab-${index}`,
      'aria-controls': `simple-tabpanel-${index}`,
    };
  }

  TabPanel(props) {
    const { children, value, index, ...other } = props;

    return (
      <div
        role="tabpanel"
        hidden={value !== index}
        id={`simple-tabpanel-${index}`}
        aria-labelledby={`simple-tab-${index}`}
        {...other}
      >
        {value === index && (
          <Box p={3}>
            <Typography>{children}</Typography>
          </Box>
        )}
      </div>
    );
  }

  render(){
  return (
    <Container>
      <AppBar position="static">
        <Tabs
          value={''}
          indicatorColor="primary"
          textColor="primary"
          centered
          onChange={this.handleChange} 
          >
              <Tab label="Home" {...this.a11yProps(0)}>
              </Tab>
              <Tab label="SinglePage" {...this.a11yProps(1)}>
              </Tab>
        </Tabs>
    </AppBar>
    <this.TabPanel value={value} index={0}>
    <HomePageComponent/>      
    </this.TabPanel>
      <TabPanel value={value} index={1}>
      <OnePost/>
      </TabPanel>
     {/*<BrowserRouter>
        <Switch>
          <Route path="/" exact >
            <HomePageComponent/>
            </Route>
          <Route path="/:slug" ><OnePost/></Route>
        </Switch>
     </BrowserRouter>*/}
    </Container>
  );

  }
}


export default App;
